('11452b0c-768e-5ff7-0d63-eeb1d8ed8cef', 'D001', 'Phòng Nghiên Cứu Và Phát Triển', 'Quo et consectetur. Omnis dolorem delectus quo corporis suscipit officiis; incidunt saepe vel nostrum ex et sed.', '2021-01-24 01:47:24', 'Phạm Minh Mạnh ', '2022-02-08 10:04:12', ' Mai Lành'),
('142cb08f-7c31-21fa-8e90-67245e8b283e', 'D004', 'Phòng Kế Toán', 'Praesentium excepturi architecto ipsum possimus. Dolore molestiae omnis nihil. Aliquid perspiciatis qui. Ea sed nam; accusantium ipsam ut. Soluta.', '2021-01-01 00:07:13', 'Trần Tuấn Mạnh ', '2022-01-01 00:00:04', ' Xuân Hồng'),
('17120d02-6ab5-3e43-18cb-66948daf6128', 'D005', 'Phòng Hành Chính', 'Neque amet ut. Natus quis ratione. Itaque tempore ut. Enim impedit magnam. Quo consectetur temporibus! Excepturi debitis perspiciatis. Quis et expedita!', '2021-04-05 03:04:46', 'Nguyễn Văn Long ', '2022-01-23 04:25:50', 'Liễu Gia Tuấn '),
('469b3ece-744a-45d5-957d-e8c757976496', 'D002', 'Phòng Nhân Sự', 'Quam odit provident dolor. Natus error velit consequatur hic vero ut! Est nemo molestiae adipisci qui quia ipsam.', '2021-02-05 04:18:16', 'Tô Thái Long ', '2022-06-10 01:02:32', 'Cao Thái Hoàng '),
('4e272fc4-7875-78d6-7d32-6a1673ffca7c', 'D003', 'Phòng Công Nghệ Thông Tin', 'Qui tempora nisi similique laboriosam illum nesciunt. Unde similique omnis voluptatem sit nisi ipsum. Illum accusantium sit quia quidem; in et fuga.', '2021-02-07 07:29:40', 'Quốc Văn Mạnh ', '2022-01-01 00:00:08', 'Trần Minh Trung ');
